import React from 'react';
import './feed.css';
import SliderPage from './slider';

class Feed extends React.Component {
  render() {
    return(
        <div>
            <label className='label'>A. TIME MANAGEMENT SKILLS</label>
            <div className='container'>
                       <p>
                          1<i class="fa fa-long-arrow-right m-2"></i>Punctuality in the Class<SliderPage />
                          2<i class="fa fa-long-arrow-right"></i>Regularity in taking Classes<SliderPage />
                          3<i class="fa fa-long-arrow-right"></i>Student's attendance/presence in the class of teacher who is being evaluated<SliderPage />
                          4<i class="fa fa-long-arrow-right"></i>Completes syllabus of the course as per teaching plan<SliderPage />
                          5<i class="fa fa-long-arrow-right"></i>Scheduled organization of assignments, class, test, quizzes and seminars<SliderPage />
                          6<i class="fa fa-long-arrow-right"></i>Makes alternate arrangement of class in his/her absence<SliderPage />
                      </p>
            </div>
            <button type="button" className='btn btn-success'>Next</button>
        </div>

    );
  }
}

export default Feed;
